import * as React from "react";

// importing material UI components
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import logo from "../assets/logo512.png";
import { Tabs, Tab } from "@mui/material";

export default function Header(onClicks) {
	const {onClickHelp=()=>{}, onClickAboutUs=()=>{}} = onClicks
	const {value='GEN', onChange=()=>{}} = props
return (
	<AppBar position="static">
		<Toolbar>
		{/*Inside the IconButton, we
		can render various icons*/}
		<IconButton
			size="large"
			edge="start"
			color="inherit"
			aria-label="menu"
			sx={{ mr: 2 }}
		>
			{/*This is a simple Menu
			Icon wrapped in Icon */}
			{/* <MenuIcon /> */}
            <img src={logo} height="30px" width="30px" alt="Logo"/>
		</IconButton>
		{/* The Typography component applies
		default font weights and sizes */}

		<Typography variant="h6"
			component="div" sx={{ flexGrow: 1 }}>
			<b>VISUALGO</b>
		</Typography>
        {/* (Supports only path finding in undirected graphs for now)
		<Button color="inherit" onClick={onClickHelp}>Help</Button>
		<Button color="inherit" onClick={onClickAboutUs}>About Us</Button> */}
		<Tabs
		value={value}
		onChange={onChange}
		textColor="primary"
		indicatorColor="primary"
		aria-label="secondary tabs example"
		variant='fullwidth'
		centered
		sx={{width:'100%'}}
		>
		<Tab value="GEN" label="Generate Random Graph" sx={{ flexGrow: 1 }}/>
		<Tab value="SEL" label="Select Algorithm" sx={{ flexGrow: 1 }}/>
		<Tab value="RUN" label="Run Algorithm" sx={{ flexGrow: 1 }}/>
		</Tabs>
		</Toolbar>
	</AppBar>
);
}
